thor":{"name":"Deven Desai","email":"bbcec020b514464468c6a99414de2031b1a0cc8b@gmail.com"},"message":"Fix for SWDEV 277899 - hipLaunchKernel called with threads per block value greater than launch bounds attribute.

Prior to the fix for SWDEV 252801, if the application code launches a GPU kernel with a threads per block value which is greater than the `__launch_bounds__` attribute value for that kernel, HIP runtime only issues a warning for this scenario.

After the fix for SWDEV 252801, HIP runtime issues an error message instead (for this scenario), and reports an error status back to the application code.

This change results in the following four TF unit test failures

```
//tensorflow/compiler/tests:depthwise_conv_op_test_gpu
//tensorflow/compiler/tests:depthwise_conv_op_test_gpu_mlir_bridge_test
//tensorflow/python:nn_grad_test_gpu
//tensorflow/python/keras/distribute:saved_model_mixed_api_test_gpu
//tensorflow/python/kernel_tests/signal:fft_ops_test
```

This commit fixes the failure in the first three of the above tests. It was caused by an incorrect calculation of the "threads per block" value. The upper bound for that value (i.e. the `__launch_bounds__` attribute value) was not getting passed to the `GetGpuLaunchConfig`. Passing that value, results in `GetGpuLaunchConfig` returning the correct "threads per block" value and the unit tests start passing","distinct":true,"url":"https://api.github.com/repos/sthagen/tensorflow/commits/3067d158ee232f51899da48574f0b30da54bf97f"},{"sha":"c79dd347afc34c20120bc27c146427267e207ec2","author":{"name":"azazhu","email":"2bff601d5fae1e367c9d016e555f2fc8a25e137d@gmail.com"},"message":"rebase","distinct":true,"url":"https://api.github.com/repos/sthagen/tensorflow/commits/c79dd347afc34c20120bc27c146427267e207ec2"},{"sha":"fca7c503f1ee1a6dfc9636f1cb3b306a9ba9853b","author":{"name":"azazhu","email":"2bff601d5fae1e367c9d016e555f2fc8a25e137d@gmail.com"},"message":"Merge branch 'github_master' into feature/disc_porting_tf_to_mhlo_pat_part2","distinct":true,"url":"https://api.github.com/repos/sthagen/tensorflow/commits/fca7c503f1ee1a6dfc9636f1cb3b306a9ba9853b"},{"sha":"2a7194488b267fc9859d412eb411539dd8da225d","author":{"name":"azazhu","email":"2bff601d5fae1e367c9d016e555f2fc8a25e137d@gmail.com"},"message":"Merge branch 'github_master' into feature/disc_porting_tf_to_mhlo_pat_part2","distinct":true,"url":"https://api.github.com/repos/sthagen/tensorflow/commits/2a7194488b267fc9859d412eb411539dd8da225d"},{"sha":"5fd1308b367e6501b8eb0b1923ce092044ad6128","author":{"name":"azazhu","email":"2bff601d5fae1e367c9d016e555f2fc8a25e137d@gmail.com"},"message":"fix compile error results from rebasing","distinct":true,"url":"https://api.github.com/repos/sthagen/tensorflow/commits/5fd1308b367e6501b8eb0b1923ce092044ad6128"},{"sha":"e8fee738339e54cccb3c3efa4b558160c063a8d2","author":{"name":"zhaozheng09","email":"a4a2d1bbce1378bcf7766e1ea49a9facd9baf106@gmail.com"},"message":"Avg parallel data in split_v